import open from 'open';
import logger from './logger';

async function launchDefaultBrowser(url: string) {
  try {
    await open(url);
  } catch (err) {
    if (err) {
      logger.error('Browser exited with error:', err);
    }
  }
}

export default launchDefaultBrowser;
